import './App.css';

const getLetterCombos = () => {
  console.log('getting letter combos');
}

function App() {
  return (
    <div className="App">
      <h1>Phone Words</h1>
      <button onClick={() => {
        getLetterCombos()
      }}>Get letter combinations</button>
    </div>
  );
}

export default App;
